# ---------------- Utility: Base64 Image Decoder ------------------
def decode_base64_image(b64_string):
    try:
        decoded = base64.b64decode(b64_string)
        return Image.open(io.BytesIO(decoded))
    except Exception as e:
        st.error(f"‚ùå Failed to decode image: {e}")
        return None

